from mongoengine import *


default_project = ''
default_project_pic = 'data:image/jpeg;base64, '
default_profile_pic = 'data:image/jpeg;base64, '


class Project(Document):
    pKey = StringField(unique=True, required=True)  # userId_projectName
    name = StringField(required=True, default="flask-example")
    port = StringField(max_length=5, default="5000")
    description = StringField(default=" here I explain about my project")
    picName = StringField(default="my project pic")
    picFormat = StringField(default="png")
    picEncodedData = StringField(default=default_project_pic)
    headerTitle = StringField(default="flask-example")
    headerSubtitle = StringField(default="Hello world using flask")
    format = StringField(default="zip")
    type = StringField(default="python")
    encoded = StringField(default=default_project)


class User(Document):
    email = EmailField(unique=True, required=True)
    password = StringField(required=True)
    name = StringField()
    description = StringField()
    projects = ListField()
    uid = StringField(required=True)
    programming_languages = StringField()
    skills = StringField()
    experience = StringField()
    date_of_birth = StringField()
    address = StringField()
    phone = StringField()
    title = StringField()
    main_description = StringField()
    picName = StringField(default='My profile picture')
    picType = StringField(default='jpeg')
    picData = StringField(default=default_profile_pic)

